import React,{Component} from "react";
import {Bar, Doughnut} from 'react-chartjs-2';

class SkillsChart extends Component
{

    constructor(props)
    {
        super(props);
        this.state = 
        {
            chartData: props.chartData
        }
    }
    render()
    {
        return(
            <div>
                <Doughnut
                    data = {this.state.chartData} 
                />
            </div>
            )
    }
}
            
export default SkillsChart
